def progress_bar(duration):
    steps = 50
    interval = duration / steps

    print("Loading the script:")
    for i in range(steps + 1):
        progress = i * 100 / steps
        bar_length = int(progress / 2)
        print("\r[{:<50}] {:.0f}%".format("=" * bar_length, progress), end="")
        time.sleep(interval)
    print()

